    public class ThetaGalleryPageViewModel : ViewModelBase
    {
        private ThetaImageItem _selectedImage;

        public ObservableCollection<ThetaImageItem> Image { get; set; }

        public ThetaImageItem SelectedImage
        {
            get => _selectedImage;
            set
            {
                _selectedImage = value;
                if (_selectedImage != null)
                    DownloadImage();
                OnPropertyChanged(nameof(SelectedImage));
            }
        }

        public ThetaGalleryPageViewModel()
        {
            Image = new ObservableCollection<ThetaImageItem>();
        }

        public void GetImages()
        {
            var imagesArray = GetFromApi();

            JObject json = JsonConvert.DeserializeObject<JObject>(imagesArray);

            var array = json.SelectToken("results").SelectToken("entries");

            var image = JsonConvert.DeserializeObject<ObservableCollection<ThetaImageItem>>(array.ToString());

            Image?.Clear();

            foreach (var item in image)
            {
                item.SetThumbnailImage();
                Image.Add(item);
            }

            OnPropertyChanged(nameof(Image));
        }

